import { Box } from '@mui/material';
import React from 'react'

function ItemBox() {

    const itemNameBox = (
        <Box
            color="black"
            bgcolor="gray" p={1}
            direction="column"
  alignItems="center">
            **Item Name**
        </Box>
    );

    return (
        <div style={{
            marginLeft: '10%',
            marginTop: '60px',
            width: '30%',
        }}>
            {itemNameBox}
        </div>
    );
}

export default ItemBox
